comment:
Заказала постельное белье жатка оптом для продажи. Расцветок, выбранных мною, не оказалось. Сказали, что отшили уже новые похожие цвета на мои (я согласилась - полная предоплата 6000грн.). Накладную об отправке товара никто не сообщил. Сама звонила выясняла, через полчаса сообщили наконец-то номер декларации.
   Самое ужасное началось когда получила посылку: 
- описание товара не соответствует действительности (ткань заявлялась турецкая, оказалась молдавская);
- качество пошива просто жуть, против всех правил (строчки кривые, в один загиб, без оверлока);
- размеры не соответствуют, не хватает по 5 -10см, наволочки пошиты 65*70 (стандарт 70*70);
 - на этикетках указана дата производства 2006г.
Увидев это всё, захотелось вернуть товар, тем более на сайте указано - возврат в течении 14дней.
Директор Наталья заявила, что они ничего принимать назад не будут. Эта компания не соблюдает никаких правил торговли, совершенно не дорожит своей репутацией, споры и разногласия решают просто отказом и отключают телефон. Будьте осторожны, читайте отзывы и не связывайтесь с такими людьми(
